import styled from 'styled-components';

export const BtnWrapper = styled.div`
  display: flex;

  .imageCircle {
    display: flex;
    justify-content: center;
    align-items: center;
    width: 30px;
    height: 30px;
    border-radius: 50%;
    box-shadow: 0px 2px 5px rgba(0, 0, 0, 0.25);
  }

  img {
    width: 30px;
    margin-left: 15px;
    cursor: pointer;
  }
`;
